    body::after{ content:""; position:fixed; inset:0; background:linear-gradient(180deg,rgba(2,6,23,.25) 0%,rgba(2,6,23,.1) 40%,rgba(2,6,23,.25) 100%); backdrop-filter: blur(1px); z-index:-1; }
    .card{width:min(92vw,520px); background:var(--card-bg); border:1px solid var(--card-border); border-radius:18px; padding:clamp(20px,4vw,36px); box-shadow:0 10px 30px rgba(2,6,23,.15);}
    .logo{width:64px;height:64px;border-radius:16px;background:white;display:grid;place-items:center;margin:0 auto 14px;border:1px solid rgba(37,99,235,.15);box-shadow:0 6px 18px rgba(37,99,235,.25);}
    .logo svg{width:30px;height:30px;fill:#2563eb}
    h1{text-align:center;margin:6px 0 6px;font-size:clamp(22px,3vw,28px)}
    .sub{text-align:center;color:#475569;margin-bottom:22px;font-size:14px}
    .field{margin-bottom:14px} .label{display:block;font-weight:600;font-size:13px;margin-bottom:8px;color:#0f172a}
    .input-wrap{position:relative} .input-wrap svg{position:absolute;left:12px;top:50%;transform:translateY(-50%);width:18px;height:18px;fill:#64748b}
    input[type="text"],input[type="password"]{width:100%;padding:12px 12px 12px 40px;border:1px solid #e2e8f0;border-radius:12px;font-size:15px;background:#fff;outline:none;transition:border-color .15s,box-shadow .15s}
    input:focus{border-color:#bfdbfe;box-shadow:0 0 0 4px rgba(37,99,235,.12)} input::placeholder{color:#94a3b8}
    .row{display:flex;justify-content:space-between;align-items:center;margin:6px 2px 16px}
